import "./landing.scss";

export default function Landing() {
  return (
    <div className="landing">
      <img alt="photo" src="./img/me.jpg"></img>
      <h1>Hello.</h1>
      <span>
        Web Developer | Software Developer | IT Generalist | Security Enthusiast
      </span>
    </div>
  );
}
